import React from 'react'
import { NoteType } from './helpers'
import Note from './Note'

type Props = {
  notes: NoteType[]
}

const Octave: React.FC<Props> = ({ notes }) => (
  <div>
    {notes.map((element: NoteType) => (
      <Note key={element.note} />
    ))}
  </div>
)

export default Octave
